using namespace std;
 
class RevealTriangle {
public:
  vector <string> calcTriangle(vector <string>);
};
 
vector <string> RevealTriangle::calcTriangle(vector <string> s) {
  int n = s.size(), i, j, k, p;
  for (i=n-2;i>=0;i--) {
    k = 0;
    for (j=0;j<n-i;j++)
      if (s[i][j] != '?') {
        k = j;
        break;
      }
    for (j=k-1;j>=0;j--) {
      p = s[i+1][j]-s[i][j+1];
      if (p < 0) p += 10;
      s[i][j] = p+48;
    }
    for (j=k+1;j<n-i;j++) {
      p = s[i+1][j-1]-s[i][j-1];
      if (p < 0) p += 10;
      s[i][j] = p+48;
    }
  }
  return s;
}
 
 
